 function openOrSenior(data){
  const emptyArray = []
  for(i = 0; i < data.length; i++) {
    if(data[i][0] >= 55 && data[i][1] > 7) {
      emptyArray.push('Senior')
    }
    else {
      emptyArray.push('Open')
    }
  }
  return emptyArray
}

console.log(openOrSenior([[25, 8]]))
